import "./HomePage.css";
export default function HomePage() {
  return (
    <div className="container">
      <h1 className="text-center">TODOLIST APP BY OMKAR PEDNEKAR</h1>
      <div className="mt-10">
        <div className="main-user-div">
          <div className="buttons-div">
            <button className="register-button">REGISTER</button>
            <button>LOGIN</button>
          </div>
          <div className="">
            <form></form>
          </div>
        </div>
      </div>
    </div>
  );
}
